import React, { useState } from 'react';
import './App.css';
//Components
import Board from './board';

function App() {
	const [ space, setspace ] = useState([
		{
			value: '1'
		},
		{
			value: ''
		},
		{
			value: '3'
		},
		{
			value: ''
		},
		{
			value: '5'
		},
		{
			value: ''
		},
		{
			value: ''
		},
		{
			value: ''
		},
		{
			value: ''
		}
	]);
	return (
		<div>
			<Board space={space} />
		</div>
	);
}

export default App;
